import '../../css/App.css';

function SillyGoose() {

    return (
        <body>
            
            <header style={{paddingLeft: '1%'}}>
                <h1><span class="text-orange">public class</span> <span class="text-green">SillyGoose</span>(){"{"}</h1> 
                <ul style={{fontSize: 28}}> <span class="text-orange">public link</span> = <a href="../../"><span class="link-blue">[Go Home]</span></a>;
                <br/>
                <span class="text-orange">public link</span> = <a href="../../dashboard"><span class="link-blue">[Go Dashboard]</span></a>;  
                <br/>
                <span class="text-orange">public link</span> = <a href="../"><span class="link-blue">[Go Back]</span></a>;  
                <br/>
                <span class="text-orange">public link</span> = <a href="../sillygoose"><span class="link-blue">[Switch]</span></a>;  
                
                    <main style={{fontSize: 25}}>
                        <br/>
                        <span class="text-orange">public void </span> <span class="text-green"> Coden</span>(){"{"}<span class="text-grey">{"//Lebe"}</span>
                        <ul>
                            <br/>
                            <span class="text-light-blue">String[1]<span class="text-yellow"> download</span> </span>=
                            <a href="https://github.com/SillyCodeDev"> <span class="link-dark-green">"Github"</span></a>;
                            <br/>
                            <span class="text-light-blue">String[2]</span> <span class="text-yellow">language</span> = <span class="text-dark-green"> "Java"</span>;
                            <br/>
                            <span class="text-light-blue">String[3]</span> <span class="text-yellow">language</span> = <span class="text-dark-green"> "C#"</span>;
                            <br/>
                            <span class="text-light-blue">String[4]</span> <span class="text-yellow">language</span> = <span class="text-dark-green"> "JavaScript"</span>;
                            <br/>
                            <span class="text-light-blue">String[5]</span> <span class="text-yellow">language</span> = <span class="text-dark-green"> "CSS/HTML"</span>;
                            <br/>
                            <span class="text-light-blue">String[6]</span> <span class="text-yellow">language</span> = <span class="text-dark-green"> "Python"</span>;
                        </ul>
                    </main>
                    {"}"}
                </ul>
                {"}"}
        </header>
            
        </body>
      );
}

export default SillyGoose;
